[{"location":"","page":"Home","title":"Home","text":"CurrentModule = WGPUCompute","category":"page"},{"location":"#WGPUCompute","page":"Home","title":"WGPUCompute","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for WGPUCompute.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [WGPUCompute]","category":"page"},{"location":"#WGPUCompute.cast-Union{Tuple{N}, Tuple{T}, Tuple{DataType, WgpuArray{T, N}}} where {T, N}","page":"Home","title":"WGPUCompute.cast","text":"cast(S::DataType, x::WgpuArray{T, N}) where {T, N}\n\nThis is a wrapper function for cast_kernel kernel function. This is meant  for users to cast from regular julia functions.\n\n\n\n\n\n","category":"method"},{"location":"#WGPUCompute.cast_kernel-Union{Tuple{N}, Tuple{S}, Tuple{T}, Tuple{WgpuArray{T, N}, WgpuArray{S, N}}} where {T, S, N}","page":"Home","title":"WGPUCompute.cast_kernel","text":"cast_kernel(x::WgpuArray{T, N}, out::WgpuArray{S, N}) where {T, S, N}\n\nThis is a compute kernel which casts the x array of eltype T to eltype S. Users are not supposed to use this function call from julia. This instead needs to  be wrapped with an additional function which uses @wgpukernel macro call to convert the julia function definition to a equivalent WGPU kernel function.\n\n\n\n\n\n","category":"method"},{"location":"#WGPUCompute.clamp-Union{Tuple{N}, Tuple{T}, Tuple{WgpuArray{T, N}, T, T}} where {T, N}","page":"Home","title":"WGPUCompute.clamp","text":"clamp(x::WgpuArray{T, N}, minValue::T, maxValue::T) where {T, N}\n\nThis is a clamp operator which takes WgpuArray as an input along with lower bound and upper bound clamp values to clamp the input array to these bounds\n\n\n\n\n\n","category":"method"}]
